pragma solidity ^0.8.0;
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/utils/StringsUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC1155/presets/ERC1155PresetMinterPauserUpgradeable.sol";
import "./Whitelist.sol";
import "./Blacklistv2.sol";
import "./ExternalLibraries.sol";

contract Tkn3blksNFTv6 is Initializable, OwnableUpgradeable, ERC1155PresetMinterPauserUpgradeable, Whitelist, Blacklistv2 {
  using SafeMath for uint256;
  mapping(uint => string) public tokenURI;
  mapping(uint256 => mapping(address => uint256)) private _balances;
   // id => creators
  mapping (uint256 => address) public creators;

    // A nonce to ensure we have a unique id each time we mint.
    uint256 public nonce;

  // modifier onlyOwner() virtual override {
  //      require(owner() == _msgSender(), "Ownable: caller is not the owner");
  //       _;
  //   }

  // modifier creatorOnly(uint256 _id) {
  //      require(creators[_id] == msg.sender);
  //       _;
  //   }
  
 function initialize(string memory _uri) public virtual override initializer ()
        { 
            __Whitelist_init();
            __Blacklistv2_init(_uri);
            __Ownable_init();
            __Ownable_init_unchained();
            __ERC1155PresetMinterPauser_init(_uri);
            _mint(msg.sender,1,999,"");
         }

function setURI(uint _id, string memory _uri) external onlyOwner {
    tokenURI[_id] = _uri;
    emit URI(_uri, _id);
  }

  function supportsInterface(bytes4 interfaceId) public view virtual override(
    ERC1155PresetMinterPauserUpgradeable) returns (bool) {
    return(ERC1155PresetMinterPauserUpgradeable.supportsInterface(interfaceId));
  }

 function safeTransferFrom(address _from, address _to, uint256 id, uint256 amount, bytes memory data) whenNotPaused()  notBlacklisted(msg.sender) 
        notBlacklisted(_from) notBlacklisted(_to) public virtual override 
  {

        if(isWhitelisted(msg.sender)){
          require(_to == owner(), 'Transfer of tokens is allowed ONLY to the owner');
        }

        if(_to != owner()){
          require(isWhitelisted(_to),'Transfer of tokens can be made by OWNER to ONLY whitelisted address');
        }
        return super.safeTransferFrom(_from, _to, id, amount, data);
  }
   
  function safeBatchTransferFrom(address _from, address _to, uint256[] memory ids,uint256[] memory amounts, bytes memory data) whenNotPaused() 
           notBlacklisted(msg.sender) notBlacklisted(_from) notBlacklisted(_to) public virtual override
  {
      
        if(isWhitelisted(msg.sender)){
          require(_to == owner());
        }

        if(_to != owner()){
          require(isWhitelisted(_to),'Transfer of tokens can be made by OWNER to ONLY whitelisted address');
        }
        return super.safeBatchTransferFrom(_from, _to, ids, amounts, data);
  }
}
